      | 364348 -> { ItemTypeData.id= 364348; name= "Vayu"; published= false; description= "The Heavy Attack Vehicle (HAV) serves as an anchoring unit for many planetary engagements, fulfilling its role as a long-range and heavily armored unit. Equipped with thick and resilient armor plating and high-capacity shielding systems, it is a tenacious defensive vehicle, able to withstand persistent onslaughts from entrenched enemies.    The Enforcer class possesses the greatest damage output and offensive reach of all HAVs, but the necessary hull modifications needed to achieve this result in weakened armor and shield output and greatly compromised speed.  "; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
