      | 364736 -> { ItemTypeData.id= 364736; name= "Armor AV - MN"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Native Minmatar tech favors straightforward solutions, a consequence of the fledgling Nation’s indigent past. Stripped of the haptic bindings and sensor technology of the Logistics suit, the Assault variant is a lightweight, low-power solution that utilizes a combination of shielding and resistive plating to thwart enemy fire. Its slimline hydraulic assisted exoskeleton enhances movement speed and user strength, while hard shell reactive armor protects the wearer from a wide-range of small arms ballistics. A mimetic recycler stores and reroutes excess power as needed.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 36488 -> { ItemTypeData.id= 36488; name= "Women's 'Hephaestus' Shirt (desert)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   This functional but high tech shirt retains the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each shirt is crafted from desert-shaded poly fabrics that are extremely durable yet comfortable enough to wear for extended periods.   "; marketGroupId= Some(1406); groupId= 1089; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365318 -> { ItemTypeData.id= 365318; name= "'Neo' Assault G-I"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.    Gallente forces have access to some of the most advanced armor systems in the cluster. An ablative-variant solution is used to dissipate energy across available surface area with only minimal degradation of the material at the impact point resulting in armor that is efficient and durable enough to maintain operational integrity for multiple short-term engagements. Augmented ferro-fibre musculature enhances the soldier’s strength, balance, and reaction time, while quad-opsis sensors allow wide arc identification and prioritization of battlefield targets.    Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
